import React, { useState } from "react";
import { Nav, NavLink, NavMenu, Logo } from "./NavbarStyle";
import ProductMenu from "../productMenu";
import { useAuth0 } from "@auth0/auth0-react";

function Navbar() {
  const { user, isAuthenticated, loginWithRedirect, logout } = useAuth0();

  const logoutWithRedirect = () =>
    logout({
      logoutParams: {
        returnTo: window.location.origin,
      },
    });

  const [showProductMenu, setShowProductMenu] = useState(false);

  const handleProductMenuClick = () => {
    setShowProductMenu(!showProductMenu);
  };

  const handleClick = (link) => {
    console.log(link);
  };

  return (
    <>
      <Nav>
        <Logo to="/" activeStyle></Logo>
        <NavMenu>
          <NavLink to="/about" activeStyle>
            ABOUT
          </NavLink>
          <NavLink to="/product" activeStyle onClick={handleProductMenuClick}>
            PRODUCT
          </NavLink>
          {showProductMenu && <ProductMenu handleClick={handleClick} />}
          <NavLink to="/roadmap" activeStyle>
            ROADMAP
          </NavLink>
          <NavLink to="/contact" activeStyle>
            CONTACT
          </NavLink>
          <NavLink to="/profile" activeStyle>
            PROFILE
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
}

export default Navbar;
